sys_variable_value.value:
(function execute(inputs, outputs) {
  function assignFreelanceGroup(){
      gr.initialize();
      gr.user = inputs.user_record;
      gr.group = gr1.sys_id;
      gr.insert();
  }
  	var gr1 = new GlideRecord('sys_user_group');
  	var gr = new GlideRecord("sys_user_grmember");
  if(gr1.get('name',inputs.freelance_category)){

     assignFreelanceGroup();
  }
  else{
    var gr2 = new GlideRecord('sys_user_group');
  	gr2.initialize();
    gr2.name = inputs.freelance_category;
    gr2.parent = '936f054a473211105da1da97436d4326';
    gr2.insert();
    gr.user = inputs.user_record;
    gr.group = gr2.sys_id;
    gr.insert();
  }
