sys_variable_value.value:
(function execute(inputs, outputs) {
  	var gr1 = new GlideRecord('sys_user_group');
  	gr1.addQuery('group','=',inputs.freelance_category);
  	gr1.query();
    if(gr1.isValidRecord()){
      var gr = new GlideRecord("sys_user_grmember");
      gr.initialize();
      gr.user = inputs.user_record;
      gr.group = gr1.sys_id;
      gr.insert();
    }

// ... code ...
})(inputs, outputs);

